import React from 'react';

const Cards = ({card}) => {
    return (
        <div  className="cards">
            <div className="card">
            <h4>{card.title}</h4>
           <iframe
            src={card.url} 
            title={card.url}
             frameborder="0" 
             allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture">
             </iframe>
             <i>Like</i>
             <i>Dislike</i>
          </div>
            

            
        </div>
    );
}

export default Cards;
